import{_ as a,o as i,c as n,e}from"./app.675f509a.js";const s="/assets/sync-log.86cadb6f.png",r={},t=e('<h1 id="_5-melihat-riwayat-sinkronisasi" tabindex="-1"><a class="header-anchor" href="#_5-melihat-riwayat-sinkronisasi" aria-hidden="true">#</a> 5. Melihat riwayat sinkronisasi</h1><p>Fitur <code>Sync log</code> menampilkan riwayat dari sinkronisasi CEMS dengan server. Pada menu ini, kita bisa melacak status pengiriman data ke server sehingga jika terjadi kesalahan atau kegagalan bisa kita ketahui waktu dan penyebabnya.</p><p>Pada tampilan <code>sync log</code> terdapat toolbar, diantaranya adalah:</p><ol><li><code>Server</code> merupakan sistem yang menerima dan mengelola data hasil pemantauan emisi dari CEMS.</li><li><code>Chimney</code> untuk memilih cerobong dari data pengukuran yang dikirimkan ke server.</li><li>Memilih waktu yang akan ditampilkan riwayat sinkronisasinya dengan klik tombol bulan di sebelah kanan tombol chimney.</li></ol><p><img src="'+s+'" alt="An image"></p><p>Informasi yang dapat kita peroleh dari riwayat sinkronisasi diantaranya adalah :</p><ol><li><code>Measurement time</code> menunjukkan waktu pengukuran emisi.</li><li><code>Message / Respons</code> menunjukan status pengiriman. Jika sinkronisasi berhasil maka akan muncul pesan <code>succes</code>. Pesan <code>failed</code> jika sinkronisasi gagal disertai dengan keterangan penyebab kegagalan sinkronisasi.</li></ol><h2 id="riwayat-sinkronisasi-dengan-sispek" tabindex="-1"><a class="header-anchor" href="#riwayat-sinkronisasi-dengan-sispek" aria-hidden="true">#</a> Riwayat sinkronisasi dengan SISPEK</h2><p>Menampilkan riwayat sinkronisasi yang dikirimkan ke SISPEK</p><h2 id="riwayat-sinkronisasi-dengan-siplah" tabindex="-1"><a class="header-anchor" href="#riwayat-sinkronisasi-dengan-siplah" aria-hidden="true">#</a> Riwayat sinkronisasi dengan SIPLAH</h2>',10),o=[t];function d(l,k){return i(),n("div",null,o)}const m=a(r,[["render",d],["__file","sync-logs.html.vue"]]);export{m as default};
